module.exports = async d => {
    const code = d.command.code 
    
    const r = code.split("$serverExists").length - 1 
    const inside = code.split("$serverExists[")[r].split("]")[0] 
    
    return {
        code: code.replaceLast(`$serverExists[${inside}]`, d.client.guilds.cache.has(inside))
    }
}